import { Navigate, Route } from "react-router-dom";

const ProtectedRoute = ({ component, isAuthenticated, ...rest }) => {
  const Component = component;

  return (
    <Route
      {...rest}
      render={(props) =>
        isAuthenticated ? <Component {...props} /> : <Navigate to="/login" />
      }
    />
  );
};

export default ProtectedRoute;
